if ($data["status"] == 4) {
    $pageObject->hideItem("submitToSupervisor", $recordId);
    $pageObject->showItem("undoSubmitToSupervisor", $recordId);
    $pageObject->hideItem("grid_edit", $recordId);
    $pageObject->hideItem("grid_details_link", $recordId);
    $pageObject->hideItem("grid_details_link1", $recordId);
    $pageObject->hideItem("grid_alldetails_link", $recordId);

} elseif ($data["status"] == 3) {
    $workdateEmpty = !isset($data["workDate"]) || trim($data["workDate"]) === "";
    $recommendationEmpty = !isset($data["reccomendation"]) || trim($data["reccomendation"]) === "";

    if ($workdateEmpty || $recommendationEmpty) {
        $pageObject->hideItem("submitToSupervisor", $recordId);
    } else {
        $pageObject->showItem("submitToSupervisor", $recordId);
    }

    $pageObject->hideItem("undoSubmitToSupervisor", $recordId);
    $pageObject->showItem("grid_edit", $recordId);
    $pageObject->showItem("grid_details_link", $recordId);
    $pageObject->showItem("grid_details_link1", $recordId);
    $pageObject->showItem("grid_alldetails_link", $recordId);

} else {
    $pageObject->hideItem("submitToSupervisor", $recordId);
    $pageObject->hideItem("undoSubmitToSupervisor", $recordId);
